import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';
import { FaFire } from 'react-icons/fa';


const Membership = () => {
    return(
        <section id="membership" class="membershipSection">
            <Container style={{maxWidth: 850 + "px"}}>
                <Row>
                    <Col>
                    padding-top: 50px;
    padding-bottom: 50px;
    margin: 0 !important;
    width: 100%;
    height: auto;
                    <QuestionList />
                    </Col>
                    <Col></Col>
                </Row>
            </Container>
        </section>
    )
}



const QuestionList = () => {
    return (
        <ul>
           <li>Du interessiert dich für den Dartsport?</li>
           <li>Du willst am Ligabetrieb teilnehmen?</li>
           <li>Du willst einen lebendigen Verein?</li>
           <li>Du willst den Verein unterstützen?</li> 
        </ul>
    )
}


export default Membership;
